import React from 'react'


const HeaderSocials = () => {
  return (
    <div className='header__socials'>
        <a className='bx bxl-linkedin-square' href="https://www.linkedin.com/in/daniel-santos1/" target="_blank"></a>
        <a className='bx bxl-github' href="https://github.com/Danielstarks" target="_blank"></a>
    </div>
  )
}

export default HeaderSocials
